description:
Known for her drive and ambitious personality, Sami loves going the extra mile and persevering in order
to help get the job done for those she is serving; as well as building strong, lasting relationships.Sami joined Stuart & Associates Real Estate Group with 7 years experience in the Life Insurance Industry;
where her passion for consultation and service began. It was in those years that Sami’s skills of negotiation and a partnership style of service and leadership flourished. Sami’s heart has always been set on utilizing those skills in a Real Estate Career; where she can combine her experience with her deep love of real estate, homes, and helping others achieve their goals/dreams.Sami is wife to Matt, and the proud Boy Mom of two energetic, loving boys, Jace and Bennett. She enjoys home design and renovations, DIY, bike riding, and travel. Sami also enjoys spending her down time with family and friends at their Lake of the Ozarks cabin.
